import React, { Component } from 'react'
import Grid from '@material-ui/core/Grid';
import PropTypes from 'prop-types';
import withStyles from '@material-ui/core/styles/withStyles';
import AppIcon1 from '../images/phone.png';
import AppIcon2 from '../images/mail.png';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';

const styles = {
    pic: {
        textAlign: 'center'
    },
    something: {
        textAlign: 'center',
        color: 'red'
    },
    icon: {
        margin: 'auto'
    }
};

export class profile extends Component {
    render() {
        const { classes } = this.props; 
        return (
            <Grid container spacing = {1}>
                    <Grid item xs = {4}>
                        <p>Pic one</p>
                    </Grid>
                    <Grid item xs = {4}>
                        <p>Pic two</p>
                    </Grid>
                    <Grid item xs = {4}>
                        <p>Pic three</p>
                    </Grid>

                    <Grid item xs = {12} className = {classes.something}>
                        <h1>Something</h1>
                    </Grid>

                    <Grid item xs = {3}> 
                        <p>pic</p>
                    </Grid>
                    <Grid item xs = {3}>
                        <p>name</p>
                    </Grid>
                    <Grid item xs = {0.5} className = {classes.icon}> 
                        <img src={AppIcon1} alt="phone" width="30" height="30" />
                    </Grid>
                    <Grid item xs = {3}>
                        <p>Phone number</p>
                    </Grid>
                    <Grid item xs = {0.5} className = {classes.icon}>
                        <img src={AppIcon2} alt="mail" width='30' height="30" />
                    </Grid>
                    <Grid item xs={2.5}>
                        <p>chelunh1@uci.edu</p>
                    </Grid>
                    <Grid container>
                    <Grid item xs>
                        <Button variant="outlined" color="primary">
                            Primary
                        </Button>
                    </Grid>
                    <Grid item xs>
                        <Button variant="outlined" color="primary">
                            Primary
                        </Button>
                    </Grid>
                    <Grid item xs>
                        <Button variant="outlined" color="primary">
                            Primary
                        </Button>
                    </Grid>
                    <Grid item xs>
                    </Grid>
                    <Grid item xs>
                        <Button variant="contained" color="primary">
                            Primary
                        </Button>
                        <Button variant="contained" color="primary">
                                Primary
                        </Button>
      <Button variant="contained" color="primary">
        Primary
      </Button>
                    </Grid>
                    </Grid>

            </Grid>
        )
    }
}

profile.propTypes = {
    classes: PropTypes.object.isRequired
};

export default withStyles(styles)(profile)
